reg [width-1:0] value;
always @(posedge clk) begin
  if (ce) begin
    value <= in;
  end
end
assign out = value;

reg [width-1:0] value;
always @(posedge clk, posedge arst) begin
  if (arst) begin
    value <= init;
  end
  else if (ce) begin
    value <= in;
  end
end
assign out = value;
